import React from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';

const SimpleSlider = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1
  };

  const slideItems = [];
  for (let i = 1; i <= 20; i++) {
    slideItems.push(
      <div key={i}>
        <h3>{i}</h3>
      </div>
    );
  }

  return (
    <div>
      <h2>Simple Slider</h2>
      <Slider {...settings}>{slideItems}</Slider>
    </div>
  );
};

export default SimpleSlider;
